import React from 'react';

const Recipe = (props) => {
    return (
        <div class="resto-card">
            <img class="resto-img" src={props.images} height="300" width="300" alt="restaurant"></img>
            <div class="resto-text">
                <h3><strong>{props.title}</strong></h3>
                <h5>{props.cuisine}</h5>
                <p>{props.suburb}</p>
            </div>
        </div>
    );
}

export default Restaurant;
